import React, { Component } from 'react';
import './Card.css'
import {list} from './list.js';
class Card extends Component{
	render(){
		return (
				<div className = 'Card'>
					<img src = {list[0].image} alt = {this.props.name} />
					<div className = 'Title'>
						<h3>{this.props.name}</h3> 
					</div>
				</div>	
			)
	}
}

export default Card;
